import React, {Component} from 'react';
import Navbar from "../../components/Navbar";

class Index extends Component {
    static async getInitialProps(props){
        console.log(props);
        return  {};
    }


    render() {
        return (
            <div>
                <Navbar/>
               <h1>User {this.props.name} Mofo</h1>
            </div>
        );
    }
}

export default Index;
